import React from 'react';
import { Link } from 'react-router-dom';
import styles from "./navbar.module.css";

export default function Navbar() {

  let name=sessionStorage.getItem("name");
  let id=sessionStorage.getItem("id");
  let token=sessionStorage.getItem("token");

  if(token!=null||token!=undefined)
  {
      document.getElementById("login").innerText="Logout";
  }


  return (
    <div className={styles.navbar}>
      <Link to="/"><img src={require("../image/logo.png")} alt='Company Logo' className={styles.imge}/></Link>
      <Link to="/hotel" className={styles.link} key="skjdnck"> <h4 className={styles.mystery}>Hotels</h4></Link>
      <h4 className={styles.history}><Link to="/property" className={styles.link} key="jnsdkcj">Properties</Link></h4>
      <h4 className={styles.technology}><Link to="/booking" className={styles.link} key="skjdbvc">Hotel Bookings</Link></h4>
      <h4 className={styles.technology} id='login'><Link to="/login" className={styles.link} key="skjdbvc">Login/Signup</Link></h4>
    </div>
  );
}
